import React, { useState, useEffect } from 'react';

const MyComponent = () => {
  const [jsonData, setJsonData] = useState(null);

  useEffect(() => {
    const fetchData = async () => {
      try {
        const response = await fetch('http://localhost:8085/api/v1/employee/images');
        const data = await response.json();
        setJsonData(data);
      } catch (error) {
        console.error('Error fetching data:', error);
      }
    };

    fetchData();
  }, []);

  return (
    <div class="container">
        <h1>Profile Hub Deployment History</h1>
        {jsonData && jsonData.images.map((repository, index) => (
            <div key={index}>
                <h2>Service : {repository[0].repositoryName}</h2>
                {repository.map((image, idx) => (
                    <div key={idx} class={`image-card ${image.isNew ? 'new' : ''}`}>
                        <span class="tag">Tag:</span> {image.imageTag} <span class="repository-name">Repository: {image.repositoryName}</span> - <span class="pushed-at">Pushed At:</span> {image.imagePushedAt}
                    </div>
                ))}
            </div>
        ))}
        <a href="/dashboard" class="back-link"><i class="fas fa-arrow-left"></i> Back to Dashboard</a>
    </div>
  );
};

export default MyComponent;
